import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from './components/navBar';
import './App.css'
function App() {
  const appStyles = {
    margin: 0,
    backgroundColor: 'white',
    height: '200vh',
    minHeight: '100vh',
    overscrollBehavior: 'none',
    zIndex: 1,
  };

  return (
    <body style={appStyles}>
      <Navbar />
    </body>
  );
}

export default App;
